import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 55.1-2539 Enforcement of chapter.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2539.md","filePath":"vacode/55.1-2539.md"}'),o={name:"vacode/55.1-2539.md"},i=a('<h1 id="§-55-1-2539-enforcement-of-chapter" tabindex="-1">§ 55.1-2539 Enforcement of chapter. <a class="header-anchor" href="#§-55-1-2539-enforcement-of-chapter" aria-label="Permalink to &quot;§ 55.1-2539 Enforcement of chapter.&quot;">​</a></h1><p>The administrator may bring an action in a court of competent jurisdiction to enforce this chapter. The administrator shall commence enforcement for compliance with the provisions of this chapter within the period specified in § <a href="/vacode/55.1-2528/">55.1-2528</a>. The holder may waive in writing the protection of this section.</p><p>1960, c. 330, § 55-210.25; 1983, c. 190; 1988, c. 643; 1991, c. 357; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0733" target="_blank" rel="noreferrer">733</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0745" target="_blank" rel="noreferrer">745</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[i];function c(h,s,f,p,l,_){return t(),r("div",null,n)}const g=e(o,[["render",c]]);export{m as __pageData,g as default};
